import { FormLabel, Form } from "react-bootstrap";
import "./PersonalInfo.css";

const PersonalInfo = ({ confirmed, onConfirmedClicked }) => {
  return (
    <div className="center">
      <h3>Personal Info</h3>

      <label>
        <input type="radio" name="test" value="small" checked />
        <img alt="a" src="http://placehold.it/40x60/0bf/fff&text=A" />
      </label>
      <label>
        <input type="radio" name="test" value="big" />
        <img alt="b" src="http://placehold.it/40x60/b0f/fff&text=B" />
      </label>

      <Form.Check
        className="gender"
        type="radio"
        name="gender"
        // id="gender"
        label="I am a..."
      ></Form.Check>
    </div>
  );
};

export default PersonalInfo;
